import "./App.css";
import mergeImages from "merge-images";

import body from "./svg/body.svg";
import face from "./svg/face.svg";
import head from "./svg/head.svg";

function App() {
  return (
    <div>
      <img
        src={mergeImages([body, head, face]).then(
          b64 => (document.querySelector("img").src = b64)
        )}
        style={{ backgroundColor: "pink", borderRadius: "100px" }}
      />
      <img src={body}></img>
    </div>
  );
}

export default App;
